import {FETCH_DRIVERS, DriversState} from "./types";
import { DriversAction} from "./types";

const initialState: DriversState = {
    drivers: []
};

export const driversReducer = (state = initialState, action: DriversAction) => {
    switch (action.type) {
        case FETCH_DRIVERS:
            return action.payload
    }
};
